import React from 'react';
import './../assets/css/ContactInfo.css';
import FacebookIcon from '@material-ui/icons/Facebook';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import EmailIcon from '@material-ui/icons/Email';
import RoomIcon from '@material-ui/icons/Room';
import ContactSupportIcon from '@material-ui/icons/ContactSupport';


function ContactInfo() {
    return (
        <div>

        <div className="contactInfo__body">
            <div className="circle" id="contactInfo">
                <div className="share">
                <ContactSupportIcon className="support"/>
                </div>
                <ul>
                    <li><FacebookIcon className="icon"/></li>
                    <li><a href="https://www.linkedin.com/in/sita-sindhuri-guntooru-580341152"><LinkedInIcon className="icon" /></a></li>
                    <li><EmailIcon className="icon"/></li>
                    <div className="contactInfo__gmailInfo">
                <h1 className="contactInfo__h1">Email</h1>
                <h2 className="contactInfo__h2">sindhu.guntur10@gmail.com</h2>
            </div>
                    <li><RoomIcon className="icon"/></li>

                </ul>

            </div>

        </div>
        </div>
    )
}

export default ContactInfo
